import React from "react";
import { saveAs } from "file-saver";

const generateVCard = () => {
  const vCardData = `
BEGIN:VCARD
VERSION:3.0
FN:Youssef OUBARI
N:OUBARI;Youssef;;;
TEL;TYPE=CELL:+212648125896
PHOTO;ENCODING=b;TYPE=JPEG:
ADR;CHARSET=UTF-8;TYPE=HOME:;;;Agadir;;;Morocco
EMAIL;CHARSET=UTF-8;type=WORK,INTERNET:youssef.oubaari@gmail.com
X-SOCIALPROFILE;TYPE=linkedin:https://www.linkedin.com/in/youssef-oubari/
X-SOCIALPROFILE;TYPE=Github:https://github.com/yusufobr
END:VCARD`;
  return new Blob([vCardData], { type: "text/vcard" });
};

const VCardButton = () => {
  const handleDownload = () => {
    const vCardBlob = generateVCard();
    saveAs(vCardBlob, "contact.vcf");
  };

  return <button onClick={handleDownload}>Contact me</button>;
};

export default VCardButton;
